import React, { useState } from "react";

const ingredients = [[
    "3 dl flour",
    "125g milk free margin",
    "2 dl oatly iMat cream",
    "1,5 dl cacao",
    "50g chopped dark chocolate",
    "2 msk light (sirap)",
    "2 tsk vanilia suger",
    "1 tsk baking powder",
    "0,5 tsk salt",
    "Instructions"
], ["Not entered yet"]];

const Recipe = ({number}) => {
    return (
        <ul>
            {ingredients[number].map((line, index) => (
                <li key={index}>
                    {line}
                </li>
            ))}
    </ul>
    )
}

export default Recipe;
